"248984":{"id":"248984","name":"Destrancados: Um Experimento na Prisão","slug":"destrancados-um-experimento-na-prisao","original_title":"Unlocked: A Jail Experiment","overview":"Neste reality, o delegado de um centro de detenção em Arkansas implementa um experimento social que oferece mais liberdade aos detentos.","first_air_date":"2024-04-10","episode_run_time":0,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Lucky 8 TV"],"genres":["Reality"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/dX0zH4z0k94h67b7oPB2YDQQX18.jpg","poster_path":"https://image.tmdb.org/t/p/original/6P47LVW00M4ZazGdCvzV9t7FvQa.jpg","cast":["Eric Higgins"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/6PeYKmXO3zqV6ULzL6KiJG7la0V.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/6PeYKmXO3zqV6ULzL6KiJG7la0V.jpg","air_date":"2024-04-10","episode_count":8,"overview":"N/A","vote_average":6.9,"episodes":{"1":{"name":"Facas e revistas","overview":"Em uma prisão do Arkansas, um delegado se prepara para lançar um novo programa radical que dá mais liberdade aos detentos, mas que também aumenta os perigos.","air_date":"2024-04-10","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/kUaYTQIP6VLBaIg6kOZm4JkFmo0.jpg","vote_average":6},"2":{"name":"O primeiro dia","overview":"Com as celas abertas e sem guardas, um detento tenta criar uma estrutura após surgir um confronto por poder entre os prisioneiros mais jovens e a geração mais velha.","air_date":"2024-04-10","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/TSTqFPSeps7wLxktogdk0SI99X.jpg","vote_average":8},"3":{"name":"Os mais velhos assumem a liderança","overview":"No fim do primeiro dia do experimento, cria-se uma rotina na cadeia. Alguns prisioneiros enfrentam ameaças e outros aproveitam suas novas liberdades.","air_date":"2024-04-10","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/dYfZwozcf8sKA6wqxMMKzEDdZEg.jpg","vote_average":7},"4":{"name":"Paizão da cadeia","overview":"Com um novo privilégio, surgem mais problemas. Um homem em prisão perpétua recebe palavras de incentivo e um líder autoproclamado gera rivalidades.","air_date":"2024-04-10","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/hsILrRCgNvrqTWwShGYgrGmgPYE.jpg","vote_average":7},"5":{"name":"Fogo e bebida","overview":"Com o programa na metade do caminho, os detentos mais velhos recuam e os mais novos continuam testando os limites. Um alarme leva os policiais à cadeia.","air_date":"2024-04-10","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/bueiC3AfhBpFSuHHWlAfQawOMTs.jpg","vote_average":6},"6":{"name":"A votação","overview":"Ao saber de um incidente, o delegado tenta descobrir quem foram os responsáveis, e o futuro do programa é colocado em risco.","air_date":"2024-04-10","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/nDH1tedqkEABUoeJQScRxFTxTdW.jpg","vote_average":7},"7":{"name":"Sangue novo","overview":"O delegado institui uma nova regalia e os detentos querem aproveitar o contato com os entes queridos. O grupo enfrenta o desafio final: novos integrantes.","air_date":"2024-04-10","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/2SfsWGXOaPaLBEqN4sclY89182H.jpg","vote_average":7},"8":{"name":"O dia da decisão","overview":"A unidade está em alerta máximo porque o clima ficou tenso. Após o fim do experimento, os detentos defendem tudo o que conquistaram. O delegado analisa suas opções.","air_date":"2024-04-10","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/vf1AgjdaI6HuZwVlomgtAbbVQka.jpg","vote_average":7}}}}},
