"116612":{"id":"116612","name":"Além do Mal","slug":"alem-do-mal","original_title":"괴물","overview":"Dois homens destemidos estão dispostos a ir a extremos na busca por um serial killer que acabou de retornar. Para descobrir a identidade do assassino, os dois são forçados a olhar além do que as pistas sugerem e questionar constantemente a inocência de todas as pessoas envolvidas no caso, incluindo eles mesmos.","first_air_date":"2021-02-19","episode_run_time":0,"vote_average":8.5,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Kim Soo-jin","Sim Na-yeon"],"production_companies":["JTBC","SLL","Celltrion Entertainment"],"genres":["Drama","Crime","Mistério"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/qCKFi1v109vOEHlc02AJFpBcS79.jpg","poster_path":"https://image.tmdb.org/t/p/original/oIus6GKFPOWIu4QKHAwy7oXyvDk.jpg","cast":["신하균","여진구","최대훈","최성은","김신록"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/lt7cYuAZDCLSxs8N2863x4DGfr.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/lt7cYuAZDCLSxs8N2863x4DGfr.jpg","air_date":"2021-02-19","episode_count":16,"overview":"Em uma cidade pequena, um crime antigo volta à tona com um novo assassinato. Dois policiais querem descobrir a verdade, mas cada um tem seus próprios segredos.","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"Quando o jovem e bem-sucedido Han Ju-won chega à cidade, é designado parceiro de Lee Dong-sik, um policial rebelde com um passado trágico.","air_date":"2021-02-19","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/gxFeA1homE3dXzdJHreiXPPTwMn.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"A descoberta de um esqueleto humano não identificado levanta possibilidades perturbadoras. Dong-sik vai até uma boate em Seoul atrás de Kang Min-jeong.","air_date":"2021-02-20","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/oWlYgOuxtnMZBvNPlTVpTOHrM9q.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Ju-won tem ainda mais suspeitas sobre o envolvimento de Dong-sik no caso. O surgimento de um celular misterioso deixa Ju-won numa saia justa.","air_date":"2021-02-26","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/7KPPF9YZjjFDJ6uXEXefHXwB4Ku.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"O interrogatório de Dong-sik não revela nenhuma pista, e a polícia cerca o açougue de Yoo Jae-i. Ju-won faz uma declaração explosiva para o público.","air_date":"2021-02-27","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/uD0lAuxwMEaZTeX4yAk5zuURPIv.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"Ao tentar proteger Kang Jin-muk, Dong-sik se envolve em uma briga. Oh Ji-hun é confrontado sobre o que aconteceu na noite do desaparecimento.","air_date":"2021-03-05","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/aJPVMY1MiYqc32oPjC6khWdf7O3.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"Jin-muk pede a Ju-won para investigar o desaparecimento da filha por conta própria. Para proteger o filho, Hae-won tenta colocar um ponto final no caso.","air_date":"2021-03-06","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/LfviQJV6IWm3xleuThl1k3cKFd.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Park Jeong-je faz a coisa certa. Uma segunda mensagem enviada por Min-jeong leva Dong-sik a investigar um suspeito.","air_date":"2021-03-12","runtime":75,"still_path":"https://image.tmdb.org/t/p/original/awb6odPD0JLDpTeTv4bgBaKxAEk.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"A notícia da prisão do assassino causa um escândalo na cidade. O criminoso só aceita falar com Dong-sik e Ju-won. O interrogatório toca em um ponto fundamental.","air_date":"2021-03-13","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/yCBuo2nrLZ5jCpWT4tYTqCiajJr.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"Seguindo a pista de um antigo vídeo, Dong-sik parte em uma busca desesperada pelo corpo de sua irmã. Ju-won e Jae-i regressam depois de três meses.","air_date":"2021-03-19","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/jKzVGegx03cu96xm8yBAzzWhN7n.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"Dong-sik acha que descobriu o verdadeiro culpado pela morte do assassino depois de ver os vídeos de segurança. Ju-won coloca um rastreador em Nam Sang-bae.","air_date":"2021-03-20","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/7zsOndb9KYm7TX5osvoAPyycGDt.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"A equipe se une para resolver o novo assassinato. Dois de seus membros estão entre os principais suspeitos.","air_date":"2021-03-26","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/aeo5pv1m9faBJ5KDYrjmkNls2sH.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"Surgem novos fatos sobre a morte de Lee Yu-yeon. Jeong-je tenta se lembrar do que aconteceu.","air_date":"2021-03-27","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/nfxDNhAxlMF2XKhttvisNEBiYQ2.jpg","vote_average":0},"13":{"name":"Episódio 13","overview":"Os detetives começam a unir os pontos, e a ligação de Han Ki-hwan com o caso fica mais evidente. Dong-sik pergunta a Han Ju-won se pode confiar nele.","air_date":"2021-04-02","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/fMtQ1yY2xjvX3dIczSmRpx1YuQx.jpg","vote_average":0},"14":{"name":"Episódio 14","overview":"Dong-sik ouve uma conversa que traz à tona muitos segredos antigos. Han Ju-won quer descobrir mais verdades.","air_date":"2021-04-03","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/CqlhJGORGe7IyF2T2CxtVjQyJw.jpg","vote_average":0},"15":{"name":"Episódio 15","overview":"Ju-won encontra provas contundentes e agora busca justiça a qualquer custo. Dong-sik e Ju-won interrogam Lee Chang-jin.","air_date":"2021-04-09","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/6mpoUiqTNJU2aLzq7j2stROO0DW.jpg","vote_average":0},"16":{"name":"Episódio 16","overview":"Depois de outra morte inesperada, Dong-sik e Ju-won se unem para prender o culpado.","air_date":"2021-04-10","runtime":79,"still_path":"https://image.tmdb.org/t/p/original/cLKsO4PgUkevYhDHifbwbz3d5Wh.jpg","vote_average":0}}}}},
