"154910":{"id":"154910","name":"Lov3","slug":"lov3","original_title":"Lov3","overview":"Quando seus pais anunciam o divórcio, os irmãos Ana, Sofia e Beto percebem que nunca foram uma família, só sobreviventes de um mesmo desastre. Agora, sozinhos, tentam provar que podem construir relações sinceras - apesar de não convencionais. Casamento aberto. Namoro poligâmico. Até um caso com um homem casado e dentro do armário. Formas distintas de uma verdade assustadora: Compromisso.","first_air_date":"2022-02-18","episode_run_time":36,"vote_average":6.2,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Felipe Braga","Rita Moraes"],"production_companies":["LB Entertainment"],"genres":["Comédia","Drama"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/4tNYzLppwo6lfzWOONyZRSzs88l.jpg","poster_path":"https://image.tmdb.org/t/p/original/5vEnasSUxuhV8WvsnuDCasuavAx.jpg","cast":["Elen Clarice","Bella Camero","João Vithor Oliveira","Chris Couto","Donizeti Mazonas"],"trailer":"XZOoKL63-b4","seasons":{"1":{"name":"Season 1","poster_path":"https://image.tmdb.org/t/p/original/5vEnasSUxuhV8WvsnuDCasuavAx.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/5vEnasSUxuhV8WvsnuDCasuavAx.jpg","air_date":"2022-02-18","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"Os gêmeos Sofia e Beto nunca sentiram muita cumplicidade em relação à irmã, Ana. É estranho ter a irmã morando com eles novamente, após decidir se separar do marido, Artur. Eles são irmãos, mas isso é tudo que parecem ter em comum. E quando a mãe deles, Baby, os surpreende com uma notícia bombástica, eles tomam uma decisão drástica: se separar de uma vez por todas, seguindo cada um o seu caminho.","air_date":"2022-02-18","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/4nYlugEml7ff3YFJTcQozRacRgb.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"Os irmãos são confrontados com as primeiras dificuldades de suas escolhas. Será que já vão dar para trás?","air_date":"2022-02-18","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/4uAEpDZdoTxrvgjhlu0BKbGG6Nv.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Depois dos desafios iniciais, as coisas parecem se encaminhar para os irmãos. A relação Ana e Artur finalmente parece estar de vento em popa. Beto consegue a permissão de Luís para trazer Hétero Curioso para seu 'local'. E Sofia bola um plano para conquistar o controle do trisal, fazendo o que ela sabe fazer de melhor… Manipular os outros. Mas eles logo irão descobrir que tudo tem um preço...","air_date":"2022-02-18","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/yYeLU2Ay41Lzkb1Xj7tA8v1jxfg.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Há muitas coisas em risco para os irmãos e suas escolhas parecem levá-los ao limite. A realidade parece frustrar suas expectativas e, quando finalmente caem na real, é preciso saber lidar com o que sobrou das ilusões.","air_date":"2022-02-18","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/lEEN7EyvpCs4jJRqX3g56clHDhH.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"Os irmãos precisam olhar para seus erros e tomar coragem para fazer o que acham que é certo. Ao mesmo tempo que encontros familiares os levam a perceber, finalmente, o que é esse 'certo' a se fazer.","air_date":"2022-02-18","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/bPJMRlSqvRfnczbnTOHN2sD7lLV.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"Lidando com sentimentos novos e desafiadores, os irmãos finalmente trabalham em conjunto ao enfrentarem seus pais mais uma vez.","air_date":"2022-02-18","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/iVXoAdJmOb5tn8Fu2z8WxStwWdA.jpg","vote_average":0}}}}},
