"134906":{"id":"134906","name":"Novo Mundo","slug":"novo-mundo","original_title":"신세계로부터","overview":"Neste reality, seis celebridades em uma ilha paradisíaca fazem de tudo para acumular uma moeda digital que, no final, poderá ser convertida em dinheiro de verdade.","first_air_date":"2021-11-20","episode_run_time":68,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Company Sang Sang"],"genres":["Reality","Comédia"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/4Ewk0ax74xqiKG2504bzHo1dQfk.jpg","poster_path":"https://image.tmdb.org/t/p/original/4WoEwPls2Ub5oNB8rXtf04KGnoa.jpg","cast":["조보아","이승기","박나래","은지원","카이"],"trailer":"m9sdlJm5gkc","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/jvjTNTHb8tGOZHkldq8ZrYyz9Nz.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/jvjTNTHb8tGOZHkldq8ZrYyz9Nz.jpg","air_date":"2021-11-20","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"Os participantes chegam à ilha, onde encontram casas incríveis e tarefas surreais. Na festa de boas-vindas, eles abrem uma caixa de Pandora de possibilidades milionárias.","air_date":"2021-11-20","runtime":78,"still_path":"https://image.tmdb.org/t/p/original/st0jCewP6IQstFVkMQp357w2yS.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"No segundo dia, o número de votos vai determinar as atividades e os destinos dos participantes.","air_date":"2021-11-20","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/399E2vXN1fteKxkLHrEFnEXLFzQ.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Um meteorito cai no meio da noite e provoca uma guerra entre os residentes, que disputam o maior prêmio em dinheiro até agora.","air_date":"2021-11-27","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/kuJtigqqkTrbFXg3hiQPdynWOsH.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Usando truques e estratégias, cada proprietário tenta lucrar mais em uma batalha imobiliária.","air_date":"2021-11-27","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/6ww5cy5klv1jL5GxXj2fFJv9tVk.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"No quarto dia, uma competição entre dois grupos acaba em confusão depois que um problema desconhecido desliga as câmeras de segurança da ilha.","air_date":"2021-12-04","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/tpBtYP593xaP0vCRK0iMRUENtbc.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"Um homem invade a casa dos participantes. Um ranking atualizado revela os vencedores e os perdedores da competição.","air_date":"2021-12-04","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/sOy1VBLNZLbaxfLqHpMGdqbBAvf.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"No quinto dia, os participantes se unem em uma primeira missão em equipe para obter pérolas valiosas e votar em quem gostariam de eliminar.","air_date":"2021-12-11","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/3AhQeqZ3d5l1mSDHI04KcrLLdq8.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Uma dupla inesperada agita o jogo no último jantar. O grupo precisa completar uma missão final antes de deixar a ilha.","air_date":"2021-12-11","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/zMNyan0Wlvl3PPSrZkQhpYgu9L9.jpg","vote_average":0}}}}},
"250361":{"id":"250361","name":"Na Luta pelo Paraíso: Alemanha","slug":"na-luta-pelo-paraiso-alemanha","original_title":"Fight for Paradise: Wem kannst Du trauen?","overview":"Seja na Mansão ou na selva, os participantes precisam manter os amigos por perto, e os inimigos mais perto ainda. Valendo uma entrada para o paraíso e 100 mil euros.","first_air_date":"2024-04-23","episode_run_time":0,"vote_average":4.333,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Banijay Productions Germany"],"genres":["Reality"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/rbK7lQVyWJuUElhisoogvWme3ZK.jpg","poster_path":"https://image.tmdb.org/t/p/original/nNClsp7waO5yrZXJhudLDpVfqBu.jpg","cast":["Bonnie Strange"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2024-04-23","episode_count":8,"overview":"N/A","vote_average":1,"episodes":{"1":{"name":"Na luta pelo paraíso","overview":"Os participantes acham que têm tudo, até serem expulsos do paraíso. Para voltar ao topo, eles precisam começar por baixo.","air_date":"2024-04-23","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/4vmbn4uQeqhR3KLyfQH7sM2YzCg.jpg","vote_average":1},"2":{"name":"Mantenha seus amigos por perto...","overview":"Uma missão no acampamento coloca uma amizade à prova. Novos participantes trazem novas oportunidades e novos conflitos.","air_date":"2024-04-23","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/bxXLV9B0MCFdjM2b9YEf5otcAsF.jpg","vote_average":0},"3":{"name":"... mas seus inimigos mais perto ainda","overview":"Alguns amigos se reúnem, outros são separados. Na viagem de iate dos escolhidos, uma notícia surpreendente acaba com a festa.","air_date":"2024-04-23","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/x1C7YtyoPKxLDSsWIaomHhorTxM.jpg","vote_average":0},"4":{"name":"As máscaras caem","overview":"A tensão aumenta nos dois acampamentos. Em um jogo de confiança, alguns participantes revelam seus sentimentos. Só que tem gente escondendo um ás na manga.","air_date":"2024-04-23","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/8J1LWjM4hue6WIEOBLn3aUXFJZ2.jpg","vote_average":0},"5":{"name":"Não confie em ninguém","overview":"Os exilados participam de uma missão difícil para ganhar uma vantagem crucial. A fidelidade de Eleyna é colocada à prova.","air_date":"2024-04-30","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/2OXcvaJw6YjbrUtVZuLI1uj6ZlD.jpg","vote_average":0},"6":{"name":"A cabeça da serpente","overview":"Um voto anônimo causa problemas no paraíso. Os resultados chegam até o acampamento da floresta, onde Marc tem dificuldade para manter a ordem.","air_date":"2024-04-30","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/jb2NMy6xIAvFnMKOgDOvNMTj9ON.jpg","vote_average":0},"7":{"name":"Teste de confiança","overview":"Todos ficam em choque com os resultados da eliminação. Os escolhidos se unem para um novo teste, e a tensão aumenta.","air_date":"2024-04-30","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/q7EATACWR1wdUGmLckzdTPzTkV3.jpg","vote_average":0},"8":{"name":"Quem vencer leva tudo","overview":"Depois de uma mudança chocante, todos precisam lutar para entrar na final. O prêmio em dinheiro está cada vez mais perto, mas uma reviravolta também.","air_date":"2024-04-30","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/3qo2DI1H7n0RMKzGh970HjstmP1.jpg","vote_average":0}}}}},
