"257168":{"id":"257168","name":"Renascido para o Asfalto","slug":"renascido-para-o-asfalto","original_title":"Resurrected Rides","overview":"O comediante Chris Redd trabalha com um time de experts para dar vida nova a carros antigos, que passam por transformações personalizadas.","first_air_date":"2024-07-24","episode_run_time":0,"vote_average":4.8,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Bright Bay Creative","Breakfast Anytime"],"genres":["Reality"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/x9pjENCaaF8wU0PwMLCqRySQZE0.jpg","poster_path":"https://image.tmdb.org/t/p/original/zvKJGYwO8VpUFgWjTKM0JAjLRge.jpg","cast":["Chris Redd"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/5jSVkv9gGFLfy8wnIC76KeQYhEM.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/5jSVkv9gGFLfy8wnIC76KeQYhEM.jpg","air_date":"2024-07-24","episode_count":8,"overview":"N/A","vote_average":5,"episodes":{"1":{"name":"Vanagon","overview":"Chris e sua talentosa equipe especialista em carros ajudam um dublê que é nerd de quadrinhos a transformar uma van surrada em um veículo irado.","air_date":"2024-07-24","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/fBWwmk3vNxLxMrniRVTHWLFMptt.jpg","vote_average":0},"2":{"name":"Mustang","overview":"Um garoto que acabou de começar a dirigir quer transformar o velho Mustang da avó em um carro de outra galáxia.","air_date":"2024-07-24","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/kU5f4hj31cIyud1ZQ8FDx045D7s.jpg","vote_average":0},"3":{"name":"Altima","overview":"Jess tem cinco cachorros e eles destruíram o carro dela. Ainda bem que Chris e sua equipe estão por perto.","air_date":"2024-07-24","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/ys87G5xzHwdIbIxC38pO0qcewVT.jpg","vote_average":0},"4":{"name":"Lexus","overview":"Com um capô enferrujado e bancos todos rasgados, o carro do fotógrafo Kevin está saindo muito feio na foto. Será que a equipe conseguirá remediar a situação?","air_date":"2024-07-24","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/sCIKJl2JDVbl2Ke06XPCu0u9X0U.jpg","vote_average":0},"5":{"name":"Econoline","overview":"Vanessa é apaixonada por água, só que não perto do carro dela. A equipe vai ter que mergulhar fundo na ferrugem para dar um toque praiano ao carro da instrutora de surfe.","air_date":"2024-07-24","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/qDkJusqCOf0D5fUJfixMSMCBZYU.jpg","vote_average":0},"6":{"name":"Ranger","overview":"A equipe da oficina escolhe uma caminhonete surrada para uma transformação apocalíptica com materiais de nível militar e pneus à prova de catástrofes inimagináveis.","air_date":"2024-07-24","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/uFV2PQuIezUn5ScaYsJA1VwGQAe.jpg","vote_average":0},"7":{"name":"Prelude","overview":"Um professor de dança animado quer dar um tapa na aparência do seu carro, só que a equipe não consegue achar o compasso certo.","air_date":"2024-07-24","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/uI2PjYTf2o6OT3PQ8oMPean9M7v.jpg","vote_average":0},"8":{"name":"Miata","overview":"Chris acha que sua colega do mundo da comédia merece a ajuda da equipe. E ainda tem um desafio de design, envolvendo um certo lagarto de estimação.","air_date":"2024-07-24","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/9cfuH1tDju3n6MfUVRbydZgZ3Lk.jpg","vote_average":0}}}}},
