"204276":{"id":"204276","name":"Turismo Selvagem","slug":"turismo-selvagem","original_title":"Wilderness","overview":"Liv e Will parecem ter tudo. Um casamento sólido. Uma vida nova e glamorosa em Nova York. Até que Liv descobre que Will tem um caso. Surge a viagem americana com a qual ela sempre sonhou. Para o Will, é uma chance de fazer as pazes. Para Liv, é uma perspectiva muito diferente – uma paisagem onde acidentes acontecem o tempo todo e o lugar perfeito para se vingar.","first_air_date":"2023-09-15","episode_run_time":0,"vote_average":6.5,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Marnie Dickens"],"production_companies":["Firebird Pictures","Amazon Studios","Nomadic Pictures"],"genres":["Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/fzhVU5SBtEfGJKwkwGhdcy3i3OU.jpg","poster_path":"https://image.tmdb.org/t/p/original/2H7xdi9t0q1tGcdWck7a4e7Thyn.jpg","cast":["Jenna Coleman","Oliver Jackson-Cohen"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/2H7xdi9t0q1tGcdWck7a4e7Thyn.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/2H7xdi9t0q1tGcdWck7a4e7Thyn.jpg","air_date":"2023-09-15","episode_count":6,"overview":"N/A","vote_average":6.9,"episodes":{"1":{"name":"Felizes Para Sempre","overview":"Com um apartamento invejável na glamourosa Nova York, um casamento intensamente apaixonado e a promessa de uma vida perfeita juntos, os britânicos recém-casados, Liv e Will, estão vivendo o sonho americano. Mas um segredo arrepiante ameaça acabar com esse conto de fadas. Uma viagem de uma vida inteira para o deserto americano pode salvar o casamento deles?","air_date":"2023-09-15","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/l3bn8WhscCrnYoi33HyUkj5WbR8.jpg","vote_average":8.667},"2":{"name":"A Outra Mulher","overview":"Liv e Will chegaram a Yosemite, mas o plano de Liv é abalado pela chegada inesperada de uma outra mulher, Cara, que traz as mentiras do passado para o presente. À medida que a rivalidade de Liv e Cara se intensifica, surgem mais revelações e, com o casamento de Liv por um fio, a vingança se torna a sua única opção.","air_date":"2023-09-15","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/b0hTgVrjtHZkIPF45EGILmPXxWz.jpg","vote_average":4},"3":{"name":"Arrependa-se à Vontade","overview":"Liv acorda com a compreensão esmagadora do que ela fez. A necessidade de um álibi é crucial, mas quando uma missão de busca começa, uma surpresa aterrorizante a espera na porta.","air_date":"2023-09-15","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/h0Zs7BssDEMbGzdIA7hJTXDJa7t.jpg","vote_average":8},"4":{"name":"Lar, Doce Lar","overview":"Em Las Vegas, um casamento conturbado está preso a um pacto tóxico. No retorno a Nova York, Liv poderá escapar das horríveis consequências da viagem quando os detetives Rawlins e Wiseman começam a se aproximar?","air_date":"2023-09-15","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/rJgnLpjJHk6CvhULD2Hbrk12FJR.jpg","vote_average":7},"5":{"name":"Tal Mãe, Tal Filha","overview":"A mãe de Liv, Caryl, chega do País de Gales e traz consigo algumas perguntas difíceis no momento em que a polícia está chegando perto de Liv.","air_date":"2023-09-15","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/teuQmH1OGBCMLpzpwIvWjVYsReV.jpg","vote_average":7},"6":{"name":"Onde os Cavaleiros Brancos Vão Para Morrer","overview":"Em uma conclusão perturbadora, o pacto tóxico de Liv finalmente atinge um ponto de ebulição, com o palco agora montado para um confronto sombrio que ninguém poderia esperar.","air_date":"2023-09-15","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/9RCJL9mQ0LTZtuKCBWelWvaAUB3.jpg","vote_average":7}}}}},
