"202212":{"id":"202212","name":"Matildas: A Caminho do Mundial","slug":"matildas-a-caminho-do-mundial","original_title":"Matildas: The World at Our Feet","overview":"Um olhar inspirador e intimista dos bastidores da história das Matildas, a seleção de futebol feminino da Austrália que se prepara para a Copa do Mundo em casa. Acompanhamos as jogadoras dentro e fora de campo, enquanto elas inspiram a próxima geração.","first_air_date":"2023-04-26","episode_run_time":41,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["STATION 10 Media","Barking Mad Productions","Boardwalk Pictures","Fremantle Australia","Fremantle"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/jCTOhqkbZDzK1kclkysiHuxVXrA.jpg","poster_path":"https://image.tmdb.org/t/p/original/WGhG4io5kDxLzoMT5gXKjgqjKe.jpg","cast":["Sam Kerr","Steph Catley","Caitlin Foord","Lydia Williams","Mary Fowler"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/WGhG4io5kDxLzoMT5gXKjgqjKe.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/WGhG4io5kDxLzoMT5gXKjgqjKe.jpg","air_date":"2023-04-26","episode_count":6,"overview":"N/A","vote_average":8,"episodes":{"1":{"name":"Ouse Sonhar","overview":"Para se prepararem para a Copa do Mundo de 2023, as Matildas embarcam numa ambiciosa jornada para enfrentar o melhor do futebol feminino. A capitã Sam Kerr tem uma rara folga em Nova York, enquanto Ellie Carpenter começa sua vida na França. O time sofre um abalo na Copa da Ásia.","air_date":"2023-04-26","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/3glJLOEKX8BDVkQHAybBNB53PgO.jpg","vote_average":0},"2":{"name":"Nós Somos uma Família","overview":"Depois da inesperada derrota na Copa da Ásia, as Matildas enfrentam suas arquirrivais, a Nova Zelândia. Após se tornar mãe, Katrina Gorry volta ao time, enquanto Mary Fowler vê a família pela primeira vez depois de três anos num reencontro emocionante.","air_date":"2023-04-26","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/gsn4t9waFv3QJ3RCoHS9O3JS9Vo.jpg","vote_average":8},"3":{"name":"Um Vínculo Especial","overview":"Depois de uma vitória dramática sobre a Nova Zelândia, a atenção das Matildas se volta para a escalação para a Copa do Mundo. Emocionada, Katrina Gorry vai jogar na Suécia e as jogadoras veteranas descansam, enquanto uma das estrelas do time se machuca.","air_date":"2023-04-26","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/9IZkeoDwpJaUJaErfcOL9NYSpHb.jpg","vote_average":0},"4":{"name":"Ganhar uma jogadora","overview":"Com as jogadoras veteranas descansando, uma nova geração de Matildas tem a chance de lutar por uma vaga na Copa do Mundo. Enquanto isso, Sam Kerr tira uma folga e um time de cara nova enfrenta um difícil desafio contra a Espanha.","air_date":"2023-04-26","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/9LEESwEm70LdDwiHObpTeF9Wv9n.jpg","vote_average":0},"5":{"name":"Sem Tempo a Perder","overview":"Depois de um descanso, as jogadoras veteranas voltam à Seleção para enfrentar as campeãs olímpicas canadenses. Durante o treino, muitas jogadoras se machucam e podem ficar de fora das partidas.","air_date":"2023-04-26","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/iNq3wTMaZcw28SuLRrhUss4HFDx.jpg","vote_average":0},"6":{"name":"Um Legado Duradouro","overview":"As Matildas querem se vingar do time que as eliminou das Olimpíadas de 2020. Elas vão enfrentar o segundo melhor time do mundo, a Suécia, depois da derrota nas semifinais no Japão. As jogadoras se unem através de dificuldades e sonhos, e prometem criar um momento histórico.","air_date":"2023-04-26","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/m29NqiNHGeYlS7vExNOFOR7qsio.jpg","vote_average":0}}}}},
