"79950":{"id":"79950","name":"All or Nothing: New Zealand All Blacks","slug":"all-or-nothing-new-zealand-all-blacks","original_title":"All or Nothing: New Zealand All Blacks","overview":"Pela primeira vez, o time de rugby mais vitorioso da história dos esportes internacionais, o New Zealand All Blacks, deixou que as câmeras entrassem em seu mundo secreto e presenciassem uma de suas temporadas mais difíceis. Durante quatro meses, eles enfrentam as exigências do esporte coletivo mais extenuante do mundo para manter um legado de domínio e excelência que começou há mais de um século.","first_air_date":"2018-05-31","episode_run_time":45,"vote_average":5.2,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["Mother Media Group","Warner Bros. International Television Production New Zealand","Pango Productions"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/fxZBr0gd2WXAbZdsUmCBLiCqlwT.jpg","poster_path":"https://image.tmdb.org/t/p/original/wbr06jHbw4EjmQsbaTt96aXUrB3.jpg","cast":["Taika Waititi"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/wbr06jHbw4EjmQsbaTt96aXUrB3.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/wbr06jHbw4EjmQsbaTt96aXUrB3.jpg","air_date":"2018-05-31","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A Camisa Negra","overview":"Os New Zealand All Blacks enfrentam os formidáveis British & Irish Lions – um confronto que ocorre uma vez a cada 12 anos. É um teste de fogo, a ponto de um dos veteranos da equipe ficar de fora por lesão. Pressionados e com o jogo equilibrado, as esperanças de toda uma nação logo caem nos ombros inexperientes de um jovem jogador que mal saiu da escola.","air_date":"2018-05-31","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/xCRySZbNnAInge7KUvxLftANpoy.jpg","vote_average":0},"2":{"name":"Jogada Desleal","overview":"Os British & Irish Lions acusam um dos All Blacks de jogo sujo – Jerome Kaino, um dos respeitados líderes da equipe. Mas é a jogada polêmica de outro astro dos All Blacks, Sonny Bill Williams, que prejudica o segundo jogo contra os Lions e faz a exigente torcida da Nova Zelândia clamar por sangue.","air_date":"2018-05-31","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/o5P4zNB1SaWooWr8fYk7aqxNGbf.jpg","vote_average":0},"3":{"name":"O Que Motiva Vocês Aqui?","overview":"No tumulto do empate com os Lions, o técnico Steve Hansen precisa escalar uma nova equipe para o desafio seguinte – o Campeonato de Rúgbi, com os maiores rivais da equipe em todo o hemisfério sul. Contra os arqui-inimigos australianos, Hansen ousa ao escalar Damian McKenzie. Uma importante decisão, devido às novidades sobre o futuro do vice-capitão Ben Smith.","air_date":"2018-05-31","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/veAESqn3mplvjQ3E51GbBlFMj4U.jpg","vote_average":0},"4":{"name":"Cinco Passos","overview":"Com o vice-capitão Ben Smith afastado, o craque Beauden Barrett assume a cobiçada liderança no jogo contra a Argentina, que ocorre na cidade natal de Barrett. Será que o formidável scrum argentino e a pressão para ser o herói da cidade são demais para os All Blacks e o melhor jogador de rúgbi do mundo?","air_date":"2018-05-31","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/nDZ8RKaQ1SN89qsJfWZWDFNzyr2.jpg","vote_average":0},"5":{"name":"Setecentos e Noventa e Nove Dias","overview":"Os All Blacks iniciam o quarto jogo do Campeonato de Rúgbi, uma partida intensa contra a África do Sul. O jogo marca o retorno de um adorado jogador e um calendário exaustivo de viagens à frente. Enquanto o capitão, Kieran Read, aproveita o tempo com a família, outro All Black se prepara para ser pai.","air_date":"2018-05-31","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/nHroq2NCDL4gncsH80vkFHFUFJy.jpg","vote_average":0},"6":{"name":"Seu Maior Rival É Você Mesmo","overview":"O legado dos All Blacks está em jogo nesta temporada, a mais difícil que a equipe já teve. Com o fim do Campeonato de Rúgbi, os All Blacks precisam jogar com tudo para levar o troféu para casa, defender a nação e consolidar o tradicional domínio que já dura um século.","air_date":"2018-05-31","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/hPNmpqnKKrVQIc0c015boVCo38j.jpg","vote_average":0}}}}},
"156315":{"id":"156315","name":"Munich Games","slug":"munich-games","original_title":"Munich Games","overview":"50 anos depois do Massacre de Munique, Munique acolhe um jogo de futebol entre um clube de futebol israelita e um alemão. Quando as coisas começam a desmoronar, parece que a história pode estar se repetindo novamente.","first_air_date":"2022-09-02","episode_run_time":45,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Michal Aviram"],"production_companies":["Amusement Park Films","CBS Studios","Sky Studios"],"genres":["Drama","Crime"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/zrGcvWpbJv36I6hazmt4iYqToxU.jpg","poster_path":"https://image.tmdb.org/t/p/original/ap67kIekmu6HOUt3NBuLyaOjB6j.jpg","cast":["Seyneb Saleh","Yousef Sweid","Sebastian Rudolph","Doval'e Glickman","Roger Azar"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/a5YoYR5OJ5tDS2FggwEgo2DsHl8.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/a5YoYR5OJ5tDS2FggwEgo2DsHl8.jpg","air_date":"2022-09-02","episode_count":6,"overview":"N/A","vote_average":6,"episodes":{"1":{"name":"A Ameaça","overview":"Um agente une esforços com uma policial após descobrir evidências de um possível ataque terrorista.","air_date":"2022-09-02","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/lzjySp7Lsen26pL20qbaaEVZomv.jpg","vote_average":6},"2":{"name":"A Chegada","overview":"O time israelense chega, tornando a situaçao mais tensa.","air_date":"2022-09-02","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/6E7HoEUzCnbZlVlWRcvdlD9qlGv.jpg","vote_average":6},"3":{"name":"Dia de Pagamento","overview":"Jackie Igelski, dono da equipe de futebol de Israel, é chantageado.","air_date":"2022-09-11","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/lmBlIglcj9Odt4ycIqtmUk7y70S.jpg","vote_average":0},"4":{"name":"Descarrilamento","overview":"Com Kresnik ainda desaparecido, parece que o jogo será cancelado.","air_date":"2022-09-18","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/eLJ2UjOKpnAbYcfT3DuYBPyTMIl.jpg","vote_average":0},"5":{"name":"O Partido","overview":"A partida tem inicio, e Maria descobre que há algo errado.","air_date":"2022-09-25","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/vDywclh8Ip3vnXIfZiQwbWNIJWD.jpg","vote_average":0},"6":{"name":"Apagão","overview":"Uma dramática situação envolvendo reféns ocorre sob o olhar do mundo inteiro.","air_date":"2022-10-02","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/lsw2s8BbRjH6d8zZrrnLoU0FisV.jpg","vote_average":0}}}}},
